contracts/BuyGb.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.7;

contract BuyGb {
  struct UserRole {
    address userAddress;
    string role;
    int256 day;
    int256 month;
    int256 year;
  }

  UserRole[] public userRoles;

  function currentRole() public view returns (UserRole[] memory) {
    return userRoles;
  }

  function buyGold(
    int256 _day,
    int256 _month,
    int256 _year
  ) public payable {
    require(msg.value == 3000000000000000 wei);

    UserRole memory userRole;

    userRole.userAddress = msg.sender;
    userRole.role = "gold";
    userRole.day = _day;
    userRole.month = _month;
    userRole.year = _year;

    userRoles.push(userRole);
  }

  function buyPreminum(
    int256 _day,
    int256 _month,
    int256 _year
  ) public payable {
    require(msg.value == 5000000000000000 wei);

    UserRole memory userRole;

    userRole.userAddress = msg.sender;
    userRole.role = "preminum";
    userRole.day = _day;
    userRole.month = _month;
    userRole.year = _year;

    userRoles.push(userRole);
  }

  function SendMony(address payable _to) external {
    _to.transfer(address(this).balance);
  }

}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

