// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

// 0xe36Ed213FdeA0cF58248373d8154E990C6076b15

contract User {

    struct MyUser {
        address publicKey;
        string userName;
    }

    MyUser[] public users;

    function getUser() public view returns (MyUser[] memory) {
        /*
        MyUser[] myArray;

        for (uint256 index = 0; index < myArray.length; index++) {
            MyUser[] arrayElement = myArray[index];
            if(arrayElement.publicKey == msg.sender) {
                myArray.push(arrayElement);
            }
        }

        return myArray;
        */

        return users;
    }

    function createUser( string memory _userName) public {
        MyUser memory user;

        user.publicKey = msg.sender;
        user.userName = _userName;

        users.push(user);
    }
}

